Registry.where(id:757).first_or_create.update(proyecto: Proyecto.find(49),user: User.find(28),created_at:"2018-09-20T00:26:34.237Z",titulo: "Visita y otras",descripcion: "Se realiz\u00f3 visita de obra en donde se checo la zapata y rodapi\u00e9, el cual no segu\u00eda detalles constructivos de acuerdo a plano y se lleg\u00f3 a un acuerdo con el Arq Natanael, se dej\u00f3 otra copia de planos y se resolvieron dudas en cuanto armado de contratrabes. En Quer\u00e9ndaro se fue a buscar a la vicepresidenta de la mesa de padres de familia y al encargado de camiones en donde no encontramos a ninguno.",resultado: "terminada",finalizado:true,updated_at: "2018-09-20T20:41:59.433Z")
