Registry.where(id:761).first_or_create.update(proyecto: Proyecto.find(20),user: User.find(28),created_at:"2018-09-20T20:47:10.302Z",titulo: "actividades del d\u00eda.",descripcion: "Hoy se realizaron dos visitas al Guayabo:\r\n* la primera se verifico las actividades a realizar en d\u00eda y prioridad, varias de estas se vieron con el Lic Daniel. Los herreros le dar\u00edan prioridad a la base de la televisi\u00f3n del estudio y la puerta de la oficina ppal. mientras que los dem\u00e1s contin\u00faan con aplanados.\r\nen la segunda visita se vio el avance para realizar trabajos posteriores en colindante (por confirmar).\r\nSe realizo pedido de material de acuerdo a observaciones",resultado: "terminado",finalizado:true,updated_at: "2018-09-21T18:10:38.496Z")
