Registry.where(id:886).first_or_create.update(proyecto: Proyecto.find(46),user: User.find(26),created_at:"2018-10-10T21:48:38.527Z",titulo: "OBRA",descripcion: "EN AVANCES DE LA OBRA SE ESTA TRABAJANDO CON TRES GRUPOS DE TRABAJADORES DESTINADOS A TAREAS DIFERENTES\r\nEL PRIMER GRUPO ENFOCADO A LA COLOCACI\u00d3N DE MONTEN EN LA CARA NORTE, SOLAMENTE EN LA PARTE ALTA, CONCLUYERON HOY CON LA COLOCACI\u00d3N DE POSTES Y TRAVESA\u00d1OS DE SOPORTE PRINCIPAL, ELABORADOS CON DOS PIEZAS DE MONTEN EN CAJ\u00d3N, Y EL SOPORTE SECUNDARIO QUE ES DE MONTEN SENCILLO CADA 1.5 M DE DISTANCIA ENTRE ELLOS, POR LO CUAL TODA LA CARA NORTE SEGUN EL DESPIECE PRESENTADO POR FANOSA ESTA COMLETO AL 100%\r\nOTRO GRUPO ENFOCADO EN LA COLOCACI\u00d3N DE MULTIMURO SOBRE LA MISMA CARA, PERO EN LA PARTE BAJA YA CERRARON TODA LA PRIMER LINEA DEL PANEL, Y HOY SE COMENZ\u00d3 CON LA COLOCACI\u00d3N DE LA SEGUNDA HILADA, CON UN AVANCE DE 6 LAMINAS, ESTO POR EL DESARMADO Y ARMADO DE ANDAMIOS PARA COLOCAR EN EL AREA DE TRABAJO, HABILITADO DE PLATAFORMAS DE 6M SOBRE LAS QUE TRABAJAN, IGUAL SE HABILITO UNA CARRUCHA PARA LEVANTAR LAS HOJAS DE MULTIMURO.\r\nY EL TERCER GRUPO DE TRABAJO SE DEDICA AL ARMADO Y CIMBRADO DEL MURETE QUE VA EN LA CARA SUR, AL D\u00cdA DE HOY TIENEN TODA LA PARRILLA ARMADA Y COLOCADA EN EL LUGAR QUE SE VA A REALIZAR, Y EN CIMBRA SE TIENEN 12 METROS CIMBRADOS.\r\nPOR ULTIMO EL PINTOR TERMINO HOY CON EL MONTEN DISPONIBLE Y YA EST\u00c1N TODOS COMPLETAMENTE PINTADOS Y EN TIEMPOS DISPONIBLES SE DEDICA A PINTAR DETALLES Y CUANDO SE LE NECESITA, APOYA A LAS CUADRILLAS COMO CHALAN.",resultado: "tarea finalizada",finalizado:true,updated_at: "2018-12-20T15:39:10.823Z")
