Registry.where(id:903).first_or_create.update(proyecto: Proyecto.find(46),user: User.find(26),created_at:"2018-10-11T22:09:52.750Z",titulo: "OBRA",descripcion: "ACTIVIDADES Y AVANCES DEL JUEVES 11/OCT/2018\r\nDE LA MISMA FORMA SE ESTUVO TRABAJANDOCON TRES CUADRILLAS,.\r\nLA PRIMER CUADRILLA ENFOCADA EN LA PARTE ALTA DEL EDIFICIO, CERRARON TODOS LOS DETALLES DE LA CARA ORIENTE, CON MOLDURAS, ESQUINEROS Y SELLADO DE LA ZONA FALTANTE, HASTA LA HORA DEL ALMUERZO, DESPUES DE LA HORA DEL ALMUERZO DESARLARON LA TORRE GRANDE DE ANDAMIOS QUE QUEDABA EN LA CARA ORIENTE PARA ARMARLO EN LA CARA NORTE DONDE SE FORMA LA ESCUADRA CON EL VOLADO Y MOVIERON LA GRUA A LA MISMA ZONA PARA SUBIR LAS LAMINAS DE MULTIMURO, DE IGUAL FORMA COLOCARON TODO EL CANAL DE LA PARTE ALTA DE LA CARA NORTE, \r\nLA SEGUNDA CUADRILLA SE ENFOCO EN LA PARTE BAJA DE LA CARA NORTE, ANTES DEL ALMUERZO COLOCARON MOLDURAS DE UNION, ANGULOS Y ZETAS PARA EL CIERRE DEL MURO, Y DESPUES DEL ALMUERZO EMPEZARON CON LA COLOCACI\u00d3N DE MAS MULTIMURO, COLOCARON DOS PIEZAS Y ENSEGUIDA LLEGO EL CAMION DE FANOSA, Y CON LA CUADRILLA DOS DE 6 TRABAJADORES SE DEDICARON A DESCARGAR EL MATERIAL, TERMINARON A LAS 4:50.\r\nLA TERCER CUADRILLA DE ALBA\u00d1ILES, SE DEDICARON AL CIMBRADO COMPLETO DEL MURETE, PLOMEADO Y COLOCACI\u00d3N DE SEPARADORES, PUNTALES, TORSALES Y AMARRES NECESARIOS PARA DEJAR LA CIMBRA COMPLETA.",resultado: "tarea completa",finalizado:true,updated_at: "2018-12-20T21:59:11.521Z")
