Registry.where(id:971).first_or_create.update(proyecto: Proyecto.find(46),user: User.find(26),created_at:"2018-10-22T22:46:44.669Z",titulo: "obra",descripcion: "EN CUANTO A LOS AVANCES DE ACTIVIDADES, DEL DIA VIERNES SABADO Y DOMINGO  SE TRABAJO EN LA ESTRUCTURA DE LA TECHUMBRE, UN LADO YA QUEDO COMPLETO EN MONTEN Y EN ARMADURAS, QUEDANDO PENDIENTE EL DETALLADO DE PINTURA POR SOLDADURA Y ALGUNAS ZONAS QUE EMPIEZAN A OXIDARSE, PERO SE PINTARA PRACTICAMENTE TODA LA ESTRUCTURA DE NUEVO PARA DEJARLA LIMPIA, ADEMAS DE QUE EN EL OTRO LADO CASI ESTAN TODAS LAS ARMADURAS SOLDADAS SOLO QUEDARON PENDIENTES LAS ULTIMAS POR MOTIVO DE QUE EL INGENIERO NOS PIDIO NO CERRAR UNA ZONA SOBRE LA QUE AUN VAN A TRABAJAR.\r\nEL DIA DE HOY SE TRABAJO EN EL INTERIOR DE LA NAVE QUE ESTA AL INTERIOR DE LA PLANTA PARA CERRAR EL MURO CON EL PANEL, YA SE HABIA CERRADO UNA CARA PERO OCUPABAN AMBAS CARAS SELLADAS SOLO QUEDARON PENDIENTES LOS ULTIMOS EMPATES DEL MURO LAS PRIMERAS LAMINAS YA QUEDARON COLOCADAS.\r\nOTRO GRUPO SE DEDICO A CERRAR TOTALMENTE LA CARA NORTE, EN LA QUE COLOCARON LAS LAMINAS FALTANTES, MOLDURAS Y SELLADO DE POLIURETANO, POR LO CUAL LA CARA NORTE ORIENTE Y PONIENTE ESTAN CERRADAS AL 100% PRACTICAMENTE.",resultado: "tarea completa",finalizado:true,updated_at: "2018-12-20T22:02:44.634Z")
